import './common.css'
function QuoteRow(props)
{
    return <tr>
                    <td width>
                        {props.quote.id}
                    </td>
                    <td>
                        {props.quote.quote}
                    </td>
                    <td>
                        {props.quote.author}
                    </td>
                    <td>
                        <button>
                            Add To Fav
                        </button>
                    </td>
           </tr>
}
export default QuoteRow;
